const HorizonLine = ({ text }) => {
  return (
    <div
      style={{
        width: "100%",
        textAlign: "justify",
        borderBottom: "1px solid #aaa",
        lineHeight: "0.1em",
        padding: "0",
        margin: "0",
      }}
    >
    </div>
  );
};

export default HorizonLine;
